type AsciiVariant = keyof typeof ASCII_VARIANTS

type HeroAsciiArt = {
  variant?: AsciiVariant
  className?: string
}

export const HeroAssetAscii = ({
  variant = "binary",
  className,
  ...props
}: React.ComponentProps<"pre"> & HeroAsciiArt) => {
  return (
    <pre
      className={cn(
        "select-none font-black font-mono text-[#DA702C] text-[3px] leading-none -tracking-widest md:text-[5px]",
        className,
        { ...props }
      )}
    >
      {ASCII_VARIANTS[variant]}
    </pre>
  )
}
